・フィリップスの純正交換HIDバルブ、アルティノンD4S 6200Kです。
<BR>・純正HID装着車用の交換バルブです。アルティノン6200Kはドレスアップ効果と実用の明るさを両立した蒼白光。シャープな輝きが愛車のフロントマスクをクールに引き締めます。
<BR>・フィリップスは自動車照明のリーディングメーカーとしてキセノン（HID）バルブ世界一を誇る工場を自社内に保有し、世界中の車両メーカーに純正採用されています。その技術はリプレイスバルブにも生かされ、NO.1ブランドにふさわしい信頼性を獲得しています。
<BR>・左右2本セットとなり、車検対応品、メーカー保証3年付きとなります。
<BR>・D4Rタイプの<B>42406GXJ</B>、D2Sタイプの<B>85122GXJ</B>、D2Rタイプの<B>85126GXJ</B>もあります。


