【商品説明】<br>ムレさえ肌によせつけない　最長１２時間さらさら！パンツ新改良ビッグより大きいサイズ新発売<br>商品区分：日用雑貨品・他<br>問い合わせ先：<BR>P&G プロクター・アンド・ギャンブル・ジャパン株式会社。0120-021321<br>原産国：日本<br>商品サイズ：305×235×145<BR><br>JANコード：4902430614559<BR>cs：4<BR><br>商品区分：日用雑貨品・他<br>問い合わせ先：P&G プロクター・アンド・ギャンブル・ジャパン株式会社。0120-021321<br>原産国：日本<p>&nbsp;</p><p>「パンパース さらさらパンツ ビッグより大きい 26枚」は、さらさらスリムジェルで、おしっこもムレも肌によせつけず、最長12時間お肌さらさらの紙おむつ Lサイズ以上です。通気性ばっちり、コットンのような肌ざわりのコットンシートを採用(コットン不使用)。ムレを逃がして赤ちゃんのお肌を健やかに保ちます。360度のびのびフィットで、昼も夜も、どんなに動いても赤ちゃんにフィット。さらにスリムになって動きやすく、コットンのようなやわらかベルトが赤ちゃんをやさしく包みます。<br><br>使用方法<br><br>パンパースパンツの上手なはき方<br>●「たっち」のとき<br>1.「Front」と書いてある方が、前です。赤ちゃんにつかまり立ちをさせてください。<br>2.オムツの足ぐりから片手を通し赤ちゃんの足を持って片方ずつオムツに通します。<br>3.オムツを上まで引き上げ、ウェスト・足回りを整えます。<br><br>●「たっちしていない」とき<br>1.「Front」と書いてある方が、前です。<br>2.オムツの足ぐりから手を通し、赤ちゃんの足を持ってオムツに通します。<br>3.赤ちゃんの動きにあわせてオムツを引き上げてください。じっとしているときは、お尻を持ち上げてください。<br><br>ご注意<br><br>●持ち手を誤って首にひっかけたり、のどに詰まらせたりすることのないように、乳幼児の手の届かないところに保管してください。<br><br>素材<br><br>表面材：ポリオレフィン不織布<br>吸収材：ポリエステル不織布、ポリオレフィン不織布、綿状パルプ、高分子吸水材<br>防水材：ポリオレフィンフィルム<br>止着材：粘着テープ<br>伸縮材：合成ゴム<br>結合材：ホットメルト粘着材<br><br>原産国<br><br>日本<br><br>お問い合わせ先<br><br>プロクター・アンド・ギャンブル・ジャパン株式会社<br>お客様相談室 0120-021329<br>(受付時間：祝日・年末年始を除く月-金の9：15-17：00)<br></p><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
